import React, { useState } from "react";
import { Grid, Typography, ButtonGroup, Button } from "@material-ui/core";
import { useStyles } from "./styles/TrackerPageStyles";
import { Doughnut, Bar } from "react-chartjs-2";
import Calendar from "react-calendar";
import "react-calendar/dist/Calendar.css";

const data = {
	labels: ["Protein", "Carbohydraetes", "Fat"],
	datasets: [
		{
			label: "Amount",
			data: [20, 40, 40],
			backgroundColor: ["red", "green", "blue"],
		},
	],
};

const TrackerPage = () => {
	const classes = useStyles();
	const [value, setValue] = useState(new Date());
	const [chartData, setChartData] = useState(data);

	console.log(value);

	return (
		<div style={{ width: "100%" }}>
			<Grid container cols={2} className={classes.root}>
				<Grid item cols={1} md={3}>
					<Calendar
						onChange={setValue}
						valu={value}
						minDetail="year"
						className={classes.calendar}
					/>
					<div>
						<Doughnut data={chartData} width={200} height={200} />
					</div>
				</Grid>
				<Grid item cols={1} md={8} className={classes.rightGridItem}>
					<Typography variant="h3">For the Week</Typography>
					<ButtonGroup
						color="primary"
						aria-label="outlined primary button group"
					>
						<Button>One</Button>
						<Button>Two</Button>
						<Button>Three</Button>
					</ButtonGroup>
				</Grid>
			</Grid>
		</div>
	);
};

export default TrackerPage;
